import React from "react";
import { Link, useNavigate } from "react-router-dom";

const Signup = () => {
  const navigate = useNavigate();

  const handleSignup = (e) => {
    e.preventDefault();
    navigate("/dashboard"); // Replace with API signup logic
  };

  return (
    <div className="flex h-screen bg-gradient-to-r from-indigo-500 to-pink-500 justify-center items-center">
      <div className="bg-white p-8 rounded-lg shadow-lg w-full max-w-md">
        <h2 className="text-3xl font-bold text-center text-gray-800">Create a New Account</h2>
        <p className="text-center text-gray-600 mb-6">Join us today!</p>
        <form onSubmit={handleSignup}>
          <div>
            <label className="block text-gray-700">Full Name</label>
            <input type="text" className="w-full p-3 border rounded-lg focus:ring-2 focus:ring-primary" required />
          </div>
          <div className="mt-4">
            <label className="block text-gray-700">Email</label>
            <input type="email" className="w-full p-3 border rounded-lg focus:ring-2 focus:ring-primary" required />
          </div>
          <div className="mt-4">
            <label className="block text-gray-700">Password</label>
            <input type="password" className="w-full p-3 border rounded-lg focus:ring-2 focus:ring-primary" required />
          </div>
          <button type="submit" className="w-full mt-6 bg-primary hover:bg-secondary text-white py-3 rounded-lg font-bold transition">
            Create Account
          </button>
        </form>
        <div className="text-center mt-4">
          <span>Already have an account? </span>
          <Link to="/" className="text-accent hover:underline">Login</Link>
        </div>
      </div>
    </div>
  );
};

export default Signup;
